    "contracts/BabyDogeDoggies.sol": {
      "content": "//SPDX-License-Identifier: MIT
import "./CustomERC721.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/Counters.sol";

pragma solidity ^0.8.12;

contract BabyDogeDoggies is CustomERC721, Ownable {
    using Counters for Counters.Counter;

    // Map the number of tokens per doggieId
    mapping(uint8 => uint256) public doggieCount;

    // Map the number of tokens burnt per doggieId
    mapping(uint8 => uint256) public doggieBurnCount;

    // Used for generating the tokenId of new NFT minted
    Counters.Counter private _tokenIds;

    // Map the doggieId for each tokenId
    mapping(uint256 => uint8) private doggieIds;

    // Map the doggieName for a tokenId
    mapping(uint8 => string) private doggieNames;

    constructor(string memory _baseURI) CustomERC721("BabyDoge Doggie", "BDD") {
        _setBaseURI(_baseURI);
    }

    /**
     * @dev Get doggieId for a specific tokenId.
     */
    function getdoggieId(uint256 _tokenId) external view returns (uint8) {
        return doggieIds[_tokenId];
    }

    /**
     * @dev Get the associated doggieName for a specific doggieId.
     */
    function getdoggieName(uint8 _doggieId)
    external
    view
    returns (string memory)
    {
        return doggieNames[_doggieId];
    }

    /**
     * @dev Get the associated doggieName for a unique tokenId.
     */
    function getdoggieNameOfTokenId(uint256 _tokenId)
    external
    view
    returns (string memory)
    {
        uint8 doggieId = doggieIds[_tokenId];
        return doggieNames[doggieId];
    }

    /**
     * @dev Mint NFTs. Only the owner can call it.
     */
    function mint(
        address _to,
        uint8 _doggieId
    ) external onlyOwner returns (uint256) {
        uint256 newId = _tokenIds.current();
        _tokenIds.increment();
        doggieIds[newId] = _doggieId;
        doggieCount[_doggieId] += 1;
        _mint(_to, newId, _doggieId);
        return newId;
    }

    /**
     * @dev Set a unique name for each doggieId. It is supposed to be called once.
     */
    function setDoggieName(uint8 _doggieId, string calldata _name)
    external
    onlyOwner
    {
        doggieNames[_doggieId] = _name;
    }

    /**
     * @dev Set a unique URI for each team
     */
    function setTeamURIs(uint[] calldata _teamIds, string[] calldata _teamURIs)
    external
    onlyOwner
    {
        for (uint i = 0; i < _teamURIs.length; i++) {
            _setTeamURI(_teamIds[i], _teamURIs[i]);
        }
    }

    /**
     * @dev Burn a NFT token. Callable by owner only.
     */
    function burn(uint256 _tokenId) external onlyOwner {
        uint8 doggieIdBurnt = doggieIds[_tokenId];
        doggieCount[doggieIdBurnt] -= 1;
        doggieBurnCount[doggieIdBurnt] += 1;
        _burn(_tokenId);
    }
}"
    },
