        // If there is no base URI, return the token URI.
        if (bytes(_baseURI).length == 0) {
            return _teamURI;
        }
        // If both are set, concatenate the baseURI and teamURI (via abi.encodePacked).
        if (bytes(_teamURI).length > 0) {
            return string(abi.encodePacked(_baseURI, _teamURI));
        }
        // If there is a baseURI but no teamURI, concatenate the tokenID to the baseURI.
        return string(abi.encodePacked(_baseURI, tokenId.toString()));
